const DUMMY_QUOTES = [
    { id: 'q1', author: 'Priyanshi', text: 'Learning React is fun!' },
    { id: 'q2', author: 'Priya', text: 'Learning React is great!' },
]

const AllQuotes = () => {
    return (
        <QuoteList quotes={DUMMY_QUOTES} />
    )
};

export default AllQuotes;
